import React, { useState } from 'react';

const App = () => {

    const [newData, setNewData] = useState('');

    const inputEvent = (event) => {
        setNewData(event.target.value);     
    }
    

    return (
        <>
                <div className='main_div'>
                    <h1>ToDo List</h1>
                    <input type='text' placeholder='Add The Items' onChange={inputEvent} />
                    <button>+</button>
                    <br />
                    
                    <ol>
                        <li>{newData}</li>
                    </ol>
                </div>
        </>
    )

}

export default App;
